function joinArraysAndSaveAsJson(arr1, arr2) {
    // Check if both arrays have the same length
    if (arr1.length !== arr2.length) {
        throw new Error('Arrays must have the same length');
    }

    // Initialize an empty array to store the result
    const result = [];

    // Iterate through the arrays and join corresponding elements
    for (let i = 0; i < arr1.length; i++) {
        result.push([arr1[i], arr2[i]]);
    }

    // Create a JSON object with the result
    const jsonData = {
        data: result
    };

    // Convert the JSON object to a string
    const jsonString = JSON.stringify(jsonData);

    // Save the JSON string to local storage or perform any other desired action
    // For demonstration, let's log the JSON string to the console
    console.log(jsonString);

    // Return the JSON string
    return jsonString;
}

function downloadJsonFile(jsonData, filename) {
    // Create a Blob object from the JSON string
    const blob = new Blob([jsonData], { type: 'application/json' });

    // Create a temporary URL for the Blob
    const url = URL.createObjectURL(blob);

    // Create a link element
    const link = document.createElement('a');

    // Set the link's attributes
    link.href = url;
    link.download = filename;

    // Append the link to the document body
    document.body.appendChild(link);

    // Programmatically click the link to trigger the download
    link.click();

    // Remove the link from the document body
    document.body.removeChild(link);

    // Revoke the Blob URL to free up memory
    URL.revokeObjectURL(url);
}


datanames.forEach((poznavacka, index) => {
    var images = scraped[index];

    let final = joinArraysAndSaveAsJson(poznavacka, images)

    downloadJsonFile(final, index);
